import React,{useState} from "react";
import { VStack, FormControl, FormLabel, Input } from "@chakra-ui/react";
export default function SignUp() {
  const [name, setname] = useState();
  return (
    <VStack spacing="5px">
      <FormControl>
        <FormLabel>
          <Input placeholder="Enter Your name"
          onChange={()=>{}}/>
        </FormLabel>
      </FormControl>
    </VStack>
  );
}
